import React from 'react';
//import './Artwork.css'
import {render} from 'react-dom';
import Gallery from 'react-photo-gallery';
import {photos} from './Photos.js';


function Artwork() {
    
        const BasicRows = () => <Gallery photos={photos} />;
        render(<BasicRows/>);
}

export default Artwork;
